import React from "react";
import "./App.css";
import Introduce from "./introduce";
import MiddleRight from './MiddleRightSide';
import PersonalDetails from './PesronalDetails';

function Left() {
    return (
        <div>
            <Introduce />
            <div class="flexdiv">
                <div class="lcol lcolsp">
                    <PersonalDetails />
                </div>
                <div class="mcol ">
                    <MiddleRight />
                </div>

            </div>
        </div>
    );
}

export default Left;
